import { Container, Grid, TextField } from '@mui/material'
import { Box } from '@mui/system'
import { styled } from '@mui/material/styles';
import React from 'react'
import Logo from './Logo.ico'




// Custom Textbox
const CTextField = styled(TextField)({

 
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: '#9B3C21',
      },
      '&:hover fieldset': {
        borderColor: '#9B3C21',
      },
  
    },
  });
  

const Login = () => {
  return (
    <div>
         <Grid container spacing={2} padding={2} >
{/* Logo Column */}
            <Grid item xs={12} sm={12} md = {8} lg={8} zeroMinWidth >

            <Grid container
                direction="column"
                justifyContent="center"
                alignItems="center"
                paddingTop={25}
                paddingBottom={2}>
                 <img src={Logo} width={500} alt='Logo' />
                
            </Grid>

</Grid>

{/* Login Column */}
            <Grid item xs={10} sm={10} md = {4} lg={4} zeroMinWidth >
            <Grid container
                direction="column"
                justifyContent="center"
                alignItems="center">
                    
                    <CTextField label='asdasd' placeholder='asdsd' fullWidth/>
             
                
            </Grid>
                 
             </Grid>
                
            
         
         </Grid>
         
         
    </div>
  )
}

export default Login
